;Reallocation is NOT possible so copper list needs to be on fixed address to assemble for testing
;Address $0 is for default runner location
	org	$0


	printt "Copper Size ----------------------------------------------"
	printv BV_FramesEnd-BV_FramesPrefix
	printt "Table Size -----------------------------------------------"
	printv BV_FramesPrefix-BV_Frames
	printt "Data Size ------------------------------------------------"
	printv BV_DataEnd-BV_FramesEnd
	printt "Total Size -----------------------------------------------"
	printv BV_DataEnd-BV_Frames
	printt "----------------------------------------------------------"


BV_Copper:
	; Blit frame fragments into current copper ----------------------------
	dc.w	$0001,$0000				;Blitter wait
	dc.w	$0040,$09f0,$0042,$0000			;BLTCON0,BLTCON1
	dc.w	$0044,$ffff,$0046,$ffff			;BLTAFWM,BLTALWM
	dc.w	$0064,$0000,$0066,$000c			;BLTAMOD,BLTDMOD
	dc.w	$0054,.CF01>>16,$0056,.CF01		;BLTDPTH,BLTDPTL
.CFRM:	dc.w	$0050,BV_Frames>>16,$0052,BV_Frames	;BLTAPTH,BLTAPTL
	dc.w	$0058,3<<6|4				;BLTSIZE
	; Blit next frame fragments location into next copper -----------------
	dc.w	$0001,$0000				;Blitter wait
	dc.w	$0066,$0000				;BLTDMOD
	dc.w	$0054,.CFRM>>16,$0056,.CFRM		;BLTDPTH,BLTDPTL
	dc.w	$0058,1<<6|4				;BLTSIZE
	; Frame fragments to jump to ------------------------------------------
	;	| COP2 fragment address | COP1 return address       | COPJMP2
.CF01:	dc.w	$0084,$0000,$0086,$0000,$0080,.CF02>>16,$0082,.CF02,$008a,$0000
	;	| COP2 fragment address | COP1 return address       | COPJMP2
.CF02:	dc.w	$0084,$0000,$0086,$0000,$0080,.CNXT>>16,$0082,.CNXT,$008a,$0000
	; Next copper list to execute -----------------------------------------
	;	| COP1 next copper list
.CNXT:	dc.w	$0080,$0000,$0082,$0000
	; Copper end ----------------------------------------------------------
	dc.w	$ffff,$fffe,$ffff,$fffe


; Frames table macros ---------------------------------------------------------
;Copper 1 location set
; \1	value.l
COP1LC:	MACRO
	dc.w	$0080,\1>>16,$0082,\1
	ENDM
;Copper 2 location set
; \1	value.l
COP2LC:	MACRO
	dc.w	$0084,\1>>16,$0086,\1
	ENDM
;Blitter SRC A location set
; \1	value.l
BLTAPT:	MACRO
	dc.w	$0050,\1>>16,$0052,\1
	ENDM
; Frames table(s) -------------------------------------------------------------
; $0000 Pointers to copper fragments called during frame
; 	Example is calling:
;		BV_FramesPrefix -> Copper prefix for all part frames
;		BV_F0000	-> Copper Frame 0000 to execute
; $0010 Pointer to next copper list to execute
; $0018 Pointer to next frame table
;------------------------------------------------------------------------------
;TODO: Remove HW registers from table leaving only clean pointers, it will
;require more complicated blitting instead of just simple copy 
